import { VictoryPie, VictoryTheme } from 'victory';
import "./Chart1.css";

function Chart1(){
    return(
            <VictoryPie
                radius={({ datum }) => datum.y + 75}
                data={[
                    { x: "Cats", y: 30 },
                    { x: "Dogs", y: 35 },
                    { x: "Birds", y: 25 },
                    { x: "Rabbits", y: 10 },
                ]}
                theme={VictoryTheme.clean}
            />
    )
}

export default Chart1;
